import { apiService } from './apiService';

export const admissionScoreService = {
    getScores(filters) {
        return apiService.get('/admissionScores', filters).then(response => {
            return {
                data: response.data.data || [],
                pagination: response.data.pagination || {
                    currentPage: 1,
                    totalPages: 1,
                    totalItems: 0,
                    itemsPerPage: 10  // Changed from 20 to 10
                }
            };
        });
    },
};
